import React, {Component} from 'react'

class Homies extends React.Component{
    constructor(){
        super()
        this.state = {}
    }

    render(){
        return(
            <div>
               <h2>My Homies!</h2> 
               <ul>
                   <li>John</li>
                   <li>Jeremy</li>
                   <li>Carlos</li>
                   <li>Emmanuel</li>
                   <li>Francis</li>
                   <li>Marlon</li>
               </ul>
            </div>
        )
    }

}
    export default Homies;
